import styled from "styled-components";
import React from "react";

function Header() {
  return (
    <HeaderContainer>
      <header>
        <h1>Hi! Welcome to my website</h1>
      </header>
    </HeaderContainer>
  );
}

export default Header;

const HeaderContainer = styled.div`
  position: fixed;
`;
